import './App.css';
import Navbars from './Navbar';
import Homepage from './Homepage';
import Blog from './Blog';
import { useEffect } from 'react';

function App() {
  useEffect
  return (
    <div className="container">
      <Navbars />
      <Homepage />
      <Blog />
    </div>
  );
}

export default App;
